export const StyledTodoList = styled.ul`
  margin: 0;
  padding: 0;
  list-style-type: none;
  min-height: 300px;
`;

export const StyledHeader = styled.header`
  display: flex;
  justify-content: space-between;
  align-items: center;
`;

export const Container = styled.div``;
